INSERT INTO products (name, description, image, price, stock, category) VALUES
('190 E 2.3-16 W201 (1984-1988)', 'El Mercedes-Benz W201, modelo 190, es compacto y eficiente, manteniendo altos estándares en prestaciones y seguridad. La versión 190 E 2.3-16, lanzada en 1983, destaca por su diseño distintivo y su réplica a escala es una adición valiosa para cualquier colección.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/181560.png', 166.27, 400, 'Automóviles'),
('190 E W201 (1982-1988)', 'El Mercedes-Benz W201, presentado en 1982, fue un éxito gracias a su diseño compacto y eficiente. La versión 190 E destacó por su innovación en prestaciones y seguridad. La maqueta a escala del modelo 190 E es una réplica detallada y práctica para cualquier colección.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/181544.png', 166.27, 400, 'Automóviles'),
('190 SL Roadster W121 (1954-1963)', 'El 190 SL, presentado en 1955, se inspiró en el diseño del 300 SL y fue un éxito con más de 25.000 unidades producidas hasta 1963. Su maqueta a escala es una adición detallada y práctica para cualquier colección.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_448x448/185336.png', 151.14, 400, 'Automóviles'),
('200 Estate S123 (1980-1985)', 'El Estate, un modelo combi espacioso, es ideal para turismo y transporte. Su maqueta a escala real, montada a mano, destaca por su reproducción fiel de detalles y practicabilidad. Viene en un embalaje exclusivo con destornillador y guante.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/187437.png', 166.27, 400, 'Automóviles'),
('200 W 114/W 115 (1968-1973), Berlina', 'El W 114/W 115, conocido como "modelos barra ocho", presentado en 1968, tiene una maqueta a escala 1:18 con detalles precisos y partes practicables. Incluye un embalaje con destornillador y guante.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/187717.png', 166.27, 400, 'Automóviles'),
('200 W123 (1980-1985)', 'El W123, sucesor de los "modelos barra ocho", fue producido durante diez años con casi 2,7 millones de vehículos. La maqueta a escala 1:18 refleja fielmente cada detalle y viene en un embalaje Mercedes Classic con destornillador y guante.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/179653.png', 166.27, 400, 'Automóviles'),
('540 K Special Roadster W29 (1936-1939)', 'El 540 K Special Roadster W29 (1936-1939) de Mercedes-Benz es un deportivo elegante esencial en colecciones. La maqueta a escala ofrece detalles de calidad y viene en un embalaje Mercedes-Benz Classic.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/175519.png', 22.52, 400, 'Automóviles'),
('CLA, Coupé, Progressive Line, C118', 'La maqueta del CLA Coupé C118 reproduce fielmente cada detalle, desde la línea Progressive hasta los faros LED High Performance. Viene en un embalaje Mercedes-Benz Classic y es ideal para cualquier colección.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/174523.png', 52.09, 400, 'Automóviles'),
('Clase A, Berlina compacta, AMG Line, W177', 'La maqueta de la Clase A AMG Line W177 reproduce fielmente cada detalle del original, desde la línea AMG hasta las llantas de aleación. Es una adición destacada para cualquier colección.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/187374.png', 55.93, 400, 'Automóviles'),
('Clase B, Sports Tourer Progressive Line, W247', 'La maqueta de la Clase B Progressive es una adición elegante para cualquier colección, con detalles precisos y embalaje Mercedes-Benz Classic.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/72285.png', 55.09, 400, 'Automóviles'),
('Clase C, Berlina, AVANTGARDE, W206', 'El Mercedes-Benz Clase C Berlina, tanto en su versión original como en la maqueta a escala, establece nuevos estándares de diseño y placer de conducción con detalles precisos. Embalaje Mercedes-Benz Classic.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/183482.png', 55.93, 400, 'Automóviles'),
('EQS, Berlina, AMG Line, V297', 'El EQS Berlina, tanto en su versión original como en la maqueta a escala, ofrece un placer de conducción excepcional con detalles precisos como la AMG Line y la pantalla PAG Hyperscreen. Viene en un embalaje Mercedes-Benz EQ.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/185346.png', 25.70, 400, 'Automóviles'),
('Sprinter, Combi', 'La maqueta de la Sprinter Combi refleja detalles precisos como el techo alto, 9 asientos y puerta corredera derecha. Es una adición ideal para cualquier colección, con embalaje Mercedes-Benz.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/66629.png', 22.88, 400, 'Automóviles'),
('Clase G', 'La Clase G de juguete es perfecta para niños y coleccionistas. Pintada en el color original, las puertas se abren y tiene función de retrofricción. Se suministra en un envase que muestra la serie completa y viene con una tarjeta para colorear.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/172980.png', 14.07, 400, 'Automóviles'),
('My first Flecha de plata', 'El coche de juguete "my first Silberpfeil" es ideal para niños a partir de dos años, fabricado con plásticos de alta calidad y diseñado en Alemania. Viene en un embalaje Mercedes-Benz Classic.', 'https://customersolutions-media.mercedes-benz.com/medienbank/shop_big/181494.png', 45.34, 0, 'Automóviles'),
